import React from 'react'; // Import React

function Logo(){
    return(
        <div className='logo'>
            <img
              src='src\assets\images\logo.png'
              alt="Integrity Protection"
              style={{ maxWidth: '500px', margin: '0 auto' }}
            />
        </div>
    )
}

export default Logo;
